DROP TABLE NOTICE_TB;

CREATE TABLE NOTICE_TB
(
     ID		    NUMBER CONSTRAINT PK_POST_ID PRIMARY KEY,
     TITLE 		VARCHAR2(100),
     WRITER     VARCHAR2(40),
     CONTENT	VARCHAR2(4000),
     REGDATE    TIMESTAMP,
     FILES      VARCHAR2(1000),
     HIT		NUMBER
);



COMMIT;

SELECT * FROM NOTICE_TB;